import React from "react";
import { useParams } from "react-router-dom";

function ProjectDetails() {
  const { id } = useParams();

  return (
    <div style={{ padding: "50px", textAlign: "center" }}>
      {id === "resume" && (
        <>
          <h1>AI Based Resume Builder</h1>
          <p>
            This project helps users create ATS-friendly resumes using AI and ML.
            It generates optimized summaries and matches job keywords.
          </p>
        </>
      )}

      {id === "retinopathy" && (
        <>
          <h1>Diabetic Retinopathy Detection System</h1>
          <p>
            This system uses DenseNet201 + ResNet50 deep learning model
            to detect diabetic retinopathy from retinal images.
          </p>
        </>
      )}
    </div>
  );
}

export default ProjectDetails;
